import React from 'react'
import WishComponent from './WishComponent'
function WishesComponent({editInputWish,setUpdateWish,wishes, startwish, editWish, deleteWish, finishWish})  {
    return (
        <div >
            {
                wishes.map((wish) => {
                    return <WishComponent
                    editWish={editWish} startwish=
                    {startwish} money={wish.money} id={wish.id} finishWish={wish.finishWish} wishText={wish.wishText} edit ={wish.edit} editInputWish={editInputWish} setUpdateWish={setUpdateWish}/>
                })
            }
        </div>
    )
}

export default WishesComponent
